import './App.css';
import Navbar from './app/Components/Navbar/Navbar';
import Main from './app/Components/main/Main';
import Events from './app/pages/Events/Events';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
 <>
 <Router>
 <Navbar/>
 <Routes>
          <Route path="/">
            <Main />
          </Route>
        </Routes>

        </Router>

 </>
  );
}

export default App;
